comment:
여자친구가 배뎃되면 모텔가준다는애는 머하는애냐..?
정신적으로 문제있는커플이냐?
니능력으로 꼬셔서 모텔을데려가라.. 한심하네;;

아 걍 이 말 많은 애들은 드라마화가 되면 좋겠다 이 개인적인 생각을 표출만 한거잖아~ 

이러이러했으면... 하는 바람들 댓글로 써보지도 못하냐~ 니들이 그런식으로 말 안해도 되는 부분은 되고 안 되는 부분은 안 돼~

말은 좀 이쁘게 하던가 진짜 인성 터진 인간들 ㄹㅇ 많네;

ㄹㅇ 툭하면 드라마 영화 이러는데 제작한다고해도 원작못따라온다고 배우 싱크 안맞는다고 욕할거면서 그냥 웹툰은 웹툰으로만 보세요;;
니들이 안떠들어도 드라마나 영화화 될 작품은 다 알아서 되는거고
개인적으로 이런 명작은 굳이 드라마나 영화로 자극적이게 만들어서 원작 망치지않았으면함
